  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143932 includes discrete
  sample and profile data collected from AURORA AUSTRALIS in the Indian Ocean, South
  Pacific Ocean and Southern Oceans (> 60 degrees South) from 2007-12-16 to 2008-01-27.
  These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113),
  CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE,
  PHOTOSYNTHETIC ACTIVE RADIATION (PAR), SALINITY, WATER TEMPERATURE, nitrate + nitrite
  content (concentration), phosphate and silicate. The instruments used to collect
  these data include CTD, PAR Sensor and bottle.nnThese data were collected by Martin
  Riddle of Australian Antarctic Division, Depatment of Sustainability, Environment,
  Water, Population and Communities and Stephen R. Rintoul of Commonwealth Scientific
  and Industrial Research Organization as part of the CLIVAR_SR03_2007 data set. CDIAC
  associated the following cruise ID(s) with this data set: AU0803 and CLIVAR_SR03_2007nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
